import React from "react";
import "./App.css";
import Page from "./Page";
import mePic from "./imgs/me.jpg";

function App() {
  return (
    <div className="App">
      <Page mainCookie = {mePic} additional = "additonal"> </Page>
      <Page mainCookie = "hi" additional = "try again"> </Page>
    </div>
  );
}

export default App;
